import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";
import { Button } from "@/components/ui/button";
import { Card, CardContent } from "@/components/ui/card";
import { useAuth } from "../context/AuthContext";
import apiService from "../services/api";
import { useNavigate } from "react-router-dom";

const DashboardPage = () => {
  const { user, isAdmin } = useAuth();
  const [issues, setIssues] = useState([]);
  const [stats, setStats] = useState({});
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState("all");
  const navigate = useNavigate();

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      if (isAdmin) {
        const response = await apiService.admin.getDashboard();
        setIssues(response.data.issues || []);
        setStats(response.data.stats || {});
      } else {
        const response = await apiService.issues.getMyIssues();
        setIssues(response.data || []);
        setStats({});
      }
    } catch (error) {
      console.error("Failed to fetch dashboard data:", error);
    } finally {
      setLoading(false);
    }
  };

  const filteredIssues = issues.filter(
    (issue) => filter === "all" || issue.status === filter
  );

  const statusFilters = [
    { value: "all", label: "All Issues", count: issues.length },
    { value: "pending", label: "Pending", count: stats?.pending || 0 },
    {
      value: "in-progress",
      label: "In Progress",
      count: stats?.["in-progress"] || 0,
    },
    { value: "resolved", label: "Resolved", count: stats?.resolved || 0 },
  ];

  if (loading) {
    return <div className="text-center py-8">Loading dashboard...</div>;
  }

  return (
    <div className="p-8 bg-gray-50 min-h-screen">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="max-w-7xl mx-auto"
      >
        <h1 className="text-4xl font-bold text-gray-900 mb-4">
          {isAdmin ? "Admin Dashboard" : "My Issues"}
        </h1>

        <p className="text-gray-600 mb-8">
          Welcome back, {user?.name || "User"}!{" "}
          {isAdmin
            ? "Here's an overview of reported issues across the campus."
            : "Here are the issues you've reported."}
        </p>

        {/* Filters */}
        <div className="flex flex-wrap gap-4 mb-8">
          {statusFilters.map((status) => (
            <Button
              key={status.value}
              variant={filter === status.value ? "default" : "outline"}
              onClick={() => setFilter(status.value)}
            >
              {status.label} ({status.count})
            </Button>
          ))}
        </div>

        {/* Issues Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filteredIssues.map((issue) => (
            <Card
              key={issue._id}
              className="hover:shadow-lg transition-shadow cursor-pointer"
              onClick={() => navigate(`/issues/${issue._id}`)}
            >
              <CardContent className="p-6">
                <h3 className="text-xl font-semibold mb-2">{issue.title}</h3>
                <p className="text-gray-600 mb-4 line-clamp-2">
                  {issue.description}
                </p>
                <div className="flex justify-between items-center">
                  <span
                    className={`px-3 py-1 rounded-full text-sm font-medium ${
                      issue.status === "pending"
                        ? "bg-yellow-100 text-yellow-800"
                        : issue.status === "in-progress"
                        ? "bg-blue-100 text-blue-800"
                        : "bg-green-100 text-green-800"
                    }`}
                  >
                    {issue.status}
                  </span>
                  <span className="text-sm text-gray-500">
                    {new Date(issue.createdAt).toLocaleDateString()}
                  </span>
                </div>
              </CardContent>
            </Card>
          ))}
        </div>

        {filteredIssues.length === 0 && (
          <div className="text-center py-12 text-gray-500">
            No issues found for this filter.
          </div>
        )}
      </motion.div>
    </div>
  );
};

export default DashboardPage;
